import React from "react";
import styled from "styled-components";

export default  function Main(){
    return(
        <>
        <MainBox  className='container'>
            <Heading>Leads unique by Email Address</Heading>

            <DataDisplay>
             <HeadBar className='flex justify-between align-center'>
                 <div>
                    <Box>

                     <div>
                         <Img src="./assets/images/calander.png"/>
                     </div>
                    </Box>
                     <Button>Compare</Button>
                 </div>
                 <div className="flex justify-between align-center">
                    <span> Group By:</span>
                    <CountryBox className="flex justify-between align-center">
                       <span>Country</span>
                       <Img src='./assets/images/downarrow.png'/>
                    </CountryBox>
                    <Box className="flex justify-between align-center">
                    <span>Stacked Bar</span>
                       <Img src='./assets/images/downarrow.png'/>
                    </Box>
                </div>
             </HeadBar>
            </DataDisplay>
        </MainBox>
        </>
    );
}

const MainBox = styled.main`
    padding: 2.5rem 3.5rem;
    background-color: rgb(248,249,250);
    border:2px solid rgb(50,50,50);
    border-radius: 1rem;
`;

const Heading = styled.h1`
 font-size: 1.5rem;
 font-weight:500;
 color:rgb(56,67,84);
 padding:1rem 0;
`;

const DataDisplay= styled.div`
background-color: rgb(255,255,255);
border: 1px solid #E3E4E8;
box-shadow: 0px 3px 3px rgba(177, 177, 177, 0.25);
border-radius: .5rem;
height:200px;
`;

const HeadBar = styled.div`

`;

const Button = styled.button`
 display: inline-block;
 color:#2c8ebf;
 border:1px solid #2c8ebf;
 border-radius:5px;
 width: 140px ;
 height: 45px;
 background-color:white;
`;

const Box = styled.div`
background-color: rgb(255,255,255);
border: 1px solid #E3E4E8;
border-radius:5px;
height: 45px;
padding:0 1rem;
`;

const GroupBox = styled(Box)`width: 500px`;

const Img = styled.img`
`;
